import Chart from "react-apexcharts";

const Donut = () => {
  return (
    <>
      <Chart
        type="donut"
        series={[23, 80]}
        options={{
          labels: ["student", "sunny"],
          chart: {
            height: "100%",
            width: "100%",
          },
          legend: {
            show: true,
            position: "bottom",
            horizontalAlign: "center",
            markers: {
              width: 12,
              height: 12,
              radius: 12,
              offsetX: 0,
              offsetY: 0,
            },
          },
          dataLabels: {
            enabled: true,
            enabledOnSeries: undefined,
            formatter: function (val, opts) {
              return val;
            },
            textAnchor: "middle",
            distributed: false,
            offsetX: 0,
            offsetY: 0,
            style: {
              fontSize: "14px",
              fontFamily: "Helvetica, Arial, sans-serif",
              fontWeight: "bold",
              colors: undefined,
            },
            background: {
              enabled: true,
              foreColor: "#fff",
              padding: 4,
              borderRadius: 2,
              borderWidth: 1,
              borderColor: "#fff",
              opacity: 0.9,
              dropShadow: {
                enabled: false,
                top: 1,
                left: 1,
                blur: 1,
                color: "#000",
                opacity: 0.45,
              },
            },
            dropShadow: {
              enabled: false,
              top: 1,
              left: 1,
              blur: 1,
              color: "#000",
              opacity: 0.45,
            },
          },
        }}
      ></Chart>
    </>
  );
};

export default Donut;
